def findSubstring(s: str, words: list[str]) -> list[int]:
    indices = []
    wordLength = len(words[0])
    listLength = wordLength*len(words)
    if (len(set(words)) == 1 and len(set(list(s))) == 1):
        if (list(words[0])[0] == list(s)[0]):
            wordTotal = ""
            for w in words:
                wordTotal += (w + "")
            return [index for index in range(0, len(s)-len(wordTotal)+1)]
        else:
            return []
    for index in range(len(s)-listLength+1):
        wordsCopy = list.copy(words)
        seq = s[index: index+listLength]
        isIndex = True
        for seqInd in range(0, len(seq)-wordLength+1, wordLength):
            w = seq[seqInd: seqInd+wordLength]
            if (w in wordsCopy):
                list.remove(wordsCopy, w)
            else:
                isIndex = False
                break
        if isIndex == True:
            indices.append(index)
    return indices

